import React from 'react';
import Card from './Card';



const CardList = ({foodP}) =>{
    return(
    foodP.map(food => {
        return (
            <div>
                <Card 
                key={food.id}
                shrt_desc={food.shrt_desc} 
                energ_kcal={food.energ_kcal}
                />
            </div>
        )
    })
    )
}


